import { Link } from "react-router-dom";

function Home() {
    const cName = "border border-blue-300 w-[50%] p-2 ml-40 mb-2 text-xl hover:text-blue-600";
    return (
        <div className="w-full h-screen flex">
            <div className="w-[25%] h-full"></div>
            <div className="flex flex-col justify-center m-5 w-[50%] h-[70%] mt-20 bg-gray-100">
            <p className="text-5xl text-justify-center m-10 text-blue-500">Official Work Flow of Al-Haiatul Ulya</p>
                <Link to="/form" className={cName}>Staff List</Link>
                <Link to="/counter" className={cName}>Event</Link>
                <Link to="/fetch" className={cName}>Work Flow</Link>
                <Link to="/time" className={cName}>Pay Scal</Link>
                <Link to="/color" className={cName}>Rulls & Regulation</Link>
                <Link to="/bulb" className={cName}>Office Time & P</Link>
                <Link to="/effect" className={cName}>Effect</Link>
            </div>
            <div className="w-[25%] h-full"></div>
        </div>
    )
};
export default Home;
